import { Outlet, Link } from "react-router-dom";
// import "../App.css";

const Layout = () => {
  return (
    <>
      <ul>
        <li>
          <Link class= "nav-item" to="/">Home</Link>
        </li>
        <li>
          <Link class= "nav-item" to="/contact">Contact</Link>
      </li>
</ul>
    </>
  )
};

export default Layout;
